import React from "react";

export default function Header() {
  return (
    <header className="fixed top-0 left-0 w-full flex items-center justify-between px-8 py-6 z-50 bg-gradient-to-b from-black/80 to-transparent backdrop-blur-md">
      <a href="#home" className="flex items-center bg-white/80 rounded-lg px-3 py-2 shadow-lg">
        <img
          src="images/icons/logo.png"
          alt="GrooveTribes Logo"
          className="h-20 w-auto"
        />
      </a>
      <nav className="hidden md:flex space-x-8 text-white text-lg font-semibold">
        <a href="#about" className="hover:text-pink-400 transition-colors">About</a>
        <a href="#work" className="hover:text-pink-400 transition-colors">Work</a>
        <a href="#contact" className="hover:text-pink-400 transition-colors">Contact</a>
      </nav>
    </header>
  );
}
